using ElectronicLibrary.Services;
using System;
using System.IO;
using System.Threading.Tasks;
using Xunit;

namespace ElectricLibrary.Services.ImageServiceTests.UnitTests
{
    public class ImageServiceShould
    {
        private const string _PATH = "C:\\Users\\Tom\\Downloads";

        [Theory]
        [InlineData("data:image/jpeg;base64,")]
        public async Task SaveFile(string image)
        {
            ImageService imageService = new ImageService();
            string imagePath = await imageService.SaveImageAsync(_PATH, image);
            Assert.NotNull(imagePath);

        }
    }
}
